@PSSI Kita menang, tetapi banyak pelajaran buat timnas :
- Timnas bermain monoton memberi umpan lambung kec kotak penalti dan ini tak effektif sebaiknya coba lebih bervariasi. 
- Belajar cara main Myanmar yang lebih effektif, minim peluang tetapi begitu ada peluang langsung jadi goal.

@PSSI Kiper tolong dibiliangin, dikasih masukan, agar jangan mudah panik dan sering bikin blunder.

Lini belakang dan kiper harus saling komunikasi.

Jangan main long ball terus, 'latihan' passing pendek aja. Kecuali pemain U16 Elkan Baggot semua, barulah main long ball.
